import React from 'react';
import { useNavigate } from 'react-router-dom';

const MangeAccount = () => {

    const changeRoute = () => {
        this.context.router.push('/promospace/detail');
    }

    return (
        <div className='manageContainer' onClick={this.changeRoute}>
            <h1>MangeAccount</h1>
        </div>
    );
}

export default MangeAccount;
